                'linked_entry_type' => 'Stats4sd\\FilamentOdkLink\\Models\\OdkLink\\SurveyRow',
                'linked_entry_id' => 145,
                'text' => '**Now I would like to talk to you about how much power and freedom women and men have to make important decisions in the food system, for example about how and what kind of food is produced, where it goes, how much it costs, and how and what kind of food people consume. Please imagine a five-step ladder, where at the bottom on the first step stand individual men and women of the community with little capacity to make their own decisions about food production, trade or consumption. These individuals have little to say about types and varieties of crops, animals, trees, they produce, the way they manage their water, land, soil, animals, and wildlife, the markets available to them, and the food source and food choices available to them. On the highest step, the fifth, stand those who have great capacity to make important decisions for themselves, including what they grow, how they manage their land, soil, water, animals, and trees, who they sell the food to, and what food they buy.**',
                'updated_during_import' => 0,
