                'linked_entry_id' => 344,
                'text' => '**Now I’d like to ask you some yes-or-no questions about foods and drinks that you consumed yesterday during the day or night, whether you had it at home or somewhere else. First, I would like you to think about yesterday, from the time you woke up through the night. Think to yourself about the first thing you ate or drank after you woke up in the morning. Think about where you were when you had any food or drink in the middle of the day. Think about where you were when you had any evening meal and any food or drink you may have had in the evening or late-night and any other snacks or drinks you may have had between meals throughout the day or night. I am interested in whether you had the food items I will mention even if they were combined with other foods. Please listen to the list of foods and drinks, and if you ate or drank ANY ONE OF THEM, say yes.**',
