        379 => 
        array (
            'id' => 2881,
            'locale_id' => 1,
            'language_string_type_id' => 1,
            'linked_entry_type' => 'Stats4sd\\FilamentOdkLink\\Models\\OdkLink\\SurveyRow',
            'linked_entry_id' => 1256,
            'text' => 'We are conducting farm-household surveys as part of the CGIAR’s Transformational Agroecology across Food, Land and Water Systems initiative. This initiative aims to develop and scale agroecological innovations with small-scale farmers and other agricultural and food system actors in eight low- and middle-income countries. Here, agroecology is an approach to achieving sustainable agri-food systems, grounded in a set of principles that emphasize the need to work with not against nature, and to achieve social justice by co-creating knowledge, increasing farmer and multi-actor participation and agency in decision-making, while better connecting producers to consumers.

One goal of the initiative is to better understand the social, economic and environmental outcomes in farm-households that are more agroecological compared to those that are less agroecological. As part of this, we are conducting farm-household survey with approximately 200 households in each of eight countries. The countries are Burkina Faso, India, Kenya, Laos, Peru, Senegal, Tunisia, and Zimbabwe.

We would like to collect data on biodiversity and soil health on your farm as part of one such survey. The survey will take 30-60 minutes and involves walking across accessible parts of the farm to observe vegetation, wildlife, and, with your permission, taking some photographs and collecting a few soil samples.

[[If doing SOCLA please add:] We would like to walk with you to inspect the soil and together answer a series of questions designed to assess the health of the soil. We realise this survey is taking place during your working day and really appreciate you taking the time to talk to us. Please feel free to pause or reschedule the survey at any point if you need to in order to minimize inconvenience to you.]

The information collected here will be summarized in a project report and academic paper. We will completely anonymize interview responses before analysis so that participants cannot be individually identified. No personal or sensitive information about participants will be published.

Your participation is entirely voluntary and you can leave at any time.

**Are you happy to continue with the interview?**',
            'updated_during_import' => 0,
            'created_at' => '2025-06-16 17:29:22',
            'updated_at' => '2025-06-16 17:29:26',
        ),
