            'id' => 2899,
            'locale_id' => 1,
            'language_string_type_id' => 1,
            'linked_entry_type' => 'Stats4sd\\FilamentOdkLink\\Models\\OdkLink\\SurveyRow',
            'linked_entry_id' => 1282,
            'text' => '**Now you will collect data on tree diversity, landscape complexity, soil and crop health, from three locations on the farm, with the first close to buildings, the second surrounded by farmland, and the third close to natural vegetation, ideally. If you have an app that can record bird sounds, you can also collect data on bird diversity.**',
            'updated_during_import' => 0,
            'created_at' => '2025-06-16 17:29:22',
            'updated_at' => '2025-06-16 17:29:26',
        ),
        398 => 
        array (
            'id' => 2900,
            'locale_id' => 1,
            'language_string_type_id' => 1,
            'linked_entry_type' => 'Stats4sd\\FilamentOdkLink\\Models\\OdkLink\\SurveyRow',
            'linked_entry_id' => 1283,
        'text' => '**First, walk to a single point on the farmland (land actively used for crop or livestock production) that is near to the homestead or other houses/buildings.** If the farm-household plots are dispersed, walk to the edge of the closest, accessible plot. Delineate a **10 x 10 meter square area** with the centre of the square corresponding to the location you are standing.',
            'updated_during_import' => 0,
            'created_at' => '2025-06-16 17:29:22',
            'updated_at' => '2025-06-16 17:29:26',
        ),
        399 => 
        array (
            'id' => 2901,
            'locale_id' => 1,
            'language_string_type_id' => 1,
            'linked_entry_type' => 'Stats4sd\\FilamentOdkLink\\Models\\OdkLink\\SurveyRow',
            'linked_entry_id' => 1284,
        'text' => '**Now, walk to a second point, this time at the centre of the farmland (land actively used for crop or livestock production) or as close as feasible to this, and ideally away from any houses or buildings.** If the farm-household plots are dispersed, walk to the centre of the largest, accessible plot. Delineate a **10 x 10 meter square area** with the centre of the square corresponding to the location you are standing.',
            'updated_during_import' => 0,
            'created_at' => '2025-06-16 17:29:22',
            'updated_at' => '2025-06-16 17:29:26',
        ),
        400 => 
        array (
            'id' => 2902,
            'locale_id' => 1,
            'language_string_type_id' => 1,
            'linked_entry_type' => 'Stats4sd\\FilamentOdkLink\\Models\\OdkLink\\SurveyRow',
            'linked_entry_id' => 1285,
        'text' => '**Now, walk to a third point, this time at the edge of the farmland (land actively used for crop or livestock production) choosing an edge that is near to natural vegetation, if possible.** If the farm-household plots are dispersed, walk to the edge of the most accessible plot that is nearest to natural vegetation and furthest from human settlements. Delineate a **10 x 10 meter square area** with the centre of the square corresponding to the location you are standing.',
            'updated_during_import' => 0,
            'created_at' => '2025-06-16 17:29:22',
            'updated_at' => '2025-06-16 17:29:26',
        ),
        401 => 
        array (
            'id' => 2903,
            'locale_id' => 1,
            'language_string_type_id' => 1,
            'linked_entry_type' => 'Stats4sd\\FilamentOdkLink\\Models\\OdkLink\\SurveyRow',
            'linked_entry_id' => 1286,
            'text' => '**Take a GPS point of the location**',
            'updated_during_import' => 0,
            'created_at' => '2025-06-16 17:29:22',
            'updated_at' => '2025-06-16 17:29:26',
        ),
