            'linked_entry_type' => 'Stats4sd\\FilamentOdkLink\\Models\\OdkLink\\SurveyRow',
            'linked_entry_id' => 1306,
        'text' => '**Now, in the same 10x10m square plot used to assess biodiversity, please collect soil samples at five points corresponding to the plot centre and each corner of the plot.** At the first sampling point, remove any crop residues from the soil surface. Use a small trowel to dig vertically to a depth of 20cm measured with a ruler (or insert the soil probe to 20cm), and place the removed soil into an sealable plastic bag. Repeat this process at the other four sampling points. Soil from each of the five sampling points should be put into the same bag. Seal the bag and label it with a unique name that identifies the farm and sample site, such as \'Farm12-Site1\'',
            'updated_during_import' => 0,
            'created_at' => '2025-06-16 17:29:22',
            'updated_at' => '2025-06-16 17:29:26',
        ),
